import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
} from "reactstrap";
import { connect } from "react-redux";
import { logout } from "../../store/actions/authActions";
import SignedInLinks from "./SignedInLinks";
import SignedOutLinks from "./SignedOutLinks";
import { withRouter, NavLink } from "react-router-dom";
const NavBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  const accesoDasboard = props.user && props.user.acceso[0].dashboard;
  const accesoMisTarjetas = props.user && props.user.acceso[0].tarjetas;

  return (
    <div>
      <nav className="nav-wrapper blue darken-3">
        <div className="container">
          {" "}
          <ul className="left">
            <li>
              <NavLink to="/">Dashboard</NavLink>
            </li>

            <li>
              <NavLink to="/roberto">Roberto</NavLink>
            </li>
            <li>
              <NavLink to="/oscar">Oscar</NavLink>
            </li>
            <li>
              <NavLink to="/jose">Jose</NavLink>
            </li>
          </ul>
          <ul className="right">
            <li>
              <NavLink to="/notifications">Notificaciones</NavLink>
            </li>
            <li>
              <a onClick={props.signOut}>Log Out</a>
            </li>
            <li>
              <NavLink to="/" className="btn btn-floating pink lighten-1">
                {props.profile.initials}
              </NavLink>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

const mapStateToProps = (state) => ({
  user: state.auth.user,
  isAuthenticated: state.auth.isAuthenticated,
});
export default connect(mapStateToProps, { logout })(withRouter(NavBar));
